import logo from './logo.svg';
import './App.css';
import { BrowserRouter,Routes,Link,Router,Route} from 'react-router-dom';
function App() {
  return (
    <Router>
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>Welcome to React</h1>
      </header>
      <link to="/VenuesList">Venues</link>
      <link to="/TeamsList">Teams</link>
      <link to="/TeamDetails">Details of Team</link>
    </div>
    <Routes>
      <Route exact path="/VenueList" element={<VenuesList/>}></Route>
      <Route exact path="/TeamList" element={<TeamList/>}></Route>
      <Route exact path="/TeamDetails" element={<TeamDetails/>}></Route>
    </Routes>
    </Router>
  );
}

export default App;
